import React from "react";
import { useLocation } from "react-router-dom";

function Result() {
    const location = useLocation();
    console.log(location.state);
    const {mbti} = location.state;
    console.log(mbti);
    return(
        <>
            <h1>결과페이지입니다</h1>
            <h2>{mbti}</h2>
        </>

    );
}

export default Result;
